function showMorph(morph) {
    if (!morph.world()) {
        alert('morph ' + morph + ' is not in the world');
        return
    }
    morph.owner.addMorphFront(morph);
    var pos = morph.worldPoint(pt(0,0));
    Global.scrollTo(pos.x, pos.y);
    this.owner.align(this.owner.bounds().topRight(), this.world().visibleBounds().topRight())
}
